import { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import {
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  Button,
  Typography,
} from "@mui/material";
import AxiosInstance from "./AxiosIntance";

export default function TodoList() {
  const [todos, setTodos] = useState([]);
  const navigate = useNavigate();

  // Sample mocking data for demonstration
//   { id: 1, description: "Playing Cricket Match",targetDate:"27-07-2025",completed:"true"},
// { id: 2, description: "Watching Movie",targetDate:"27-07-2025",completed:"false" },
// { id: 3, description: "Roaming with Friends",targetDate:"27-07-2025",completed:"false" }

// const deleteTodo = (id)=>{
//     setTodos(prev=>prev.filter(todo=>todo.id!==id))
//   }

//   const markComplete = (todo) => {
//     setTodos(prev=>prev.map(t=>t.id===todo.id?({...t,completed:true}):t))
//   };

  const fetchTodos = () => {
  AxiosInstance.get("/todos")
    .then((res) => {
      const data = res.data;
      setTodos(Array.isArray(data) ? data : []);
    })
    .catch((err) => {
      console.error("Failed to fetch todos:", err.response?.data || err.message);
      setTodos([]); // Optional: clear list on error
    });
};

  useEffect(() => {
    fetchTodos();
  }, []);

  // Delete todo by id
  const deleteTodo = (id) => {
  AxiosInstance.delete(`/todos/${id}`)
    .then(fetchTodos)
    .catch((err) => {
      console.error("Failed to delete todo:", err.response?.data || err.message);
    });
};

  // Mark todo as completed
  const markComplete = (todo) => {
    AxiosInstance.put(`todos/${todo.id}`,{
      ...todo,done:true,
    }).then(()=>fetchTodos())
      .catch((err) => {console.error("Failed to mark todo as complete:", err);
  });
  };

  return (
    <div>
      <Typography variant="h5" gutterBottom>
        üìã All Todos
      </Typography>
      {todos.length === 0 ? (
        <Typography>No todos found.</Typography>
      ) : (
        <TableContainer
          component={Paper}
          sx={{ maxWidth: 700, margin: "auto" }}
        >
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>Description</TableCell>
                <TableCell>Due Date</TableCell>
                <TableCell>Status</TableCell>
                <TableCell>Actions</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {todos.map((todo) => (
                <TableRow
                  key={todo.id}
                  sx={{
                    backgroundColor: todo.done ? "#e6ffe6" : "#fffbe6",
                  }}
                >
                  <TableCell>{todo.description}</TableCell>
                  <TableCell>
                    {new Date(todo.targetDate).toLocaleDateString()}
                  </TableCell>
                  <TableCell>
                    <span
                      style={{
                        color: todo.done ? "green" : "#f39c12",
                        fontWeight: "bold",
                      }}
                    >
                      {todo.done ? "Completed" : "Pending"}
                    </span>
                  </TableCell>
                  <TableCell>
                    <Button
                      variant="outlined"
                      color="primary"
                      size="small"
                      onClick={() => navigate(`/todoshome/edit/${todo.id}`)}
                      sx={{ mr: 1 }}
                    >
                      ‚úèÔ∏è
                    </Button>
                    <Button
                      variant="outlined"
                      color="error"
                      size="small"
                      onClick={() => deleteTodo(todo.id)}
                      sx={{ mr: 1 }}
                    >
                      üóëÔ∏è
                    </Button>
                    {!todo.completed && (
                      <Button
                        variant="contained"
                        color="success"
                        size="small"
                        onClick={() => markComplete(todo)}
                      >
                        ‚úÖ
                      </Button>
                    )}
                  </TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
      )}
    </div>
  );
}
